import random
import time

def subsetsumApproximation(set, target):
    start_time = time.perf_counter()
    bestSet = []
    bestVal = target

    for i in range(len(set)):
        bestSet.append(0)

    random.shuffle(set)

    repetitions = 50

    for i in range(repetitions):

        #first phase, randomized selection.
        currentSet = []
        for j in range(len(set)):
            currentSet.append(0)




        for x in range(len(set)):

            currentValue = set[x]

            absoluteError = absoluteErrorCalculate(set, currentSet, target)

            if currentValue <= absoluteError:

                currentSet[x] = 1





        #second phase, local improvement

        for j in range(len(set)):
            # While the absolute error isn't zero, for each num in the set
            if absoluteErrorCalculate(set, currentSet, target) != 0:


                if currentSet[j] == 1:

                    bestSwap = -1
                    bestSwapValue = absoluteErrorCalculate(set, currentSet, target)


                    # Go through all the non set nums
                    # And find the best swap and do it
                    for x in range(len(set)):

                        #If current num in set is 0;
                        if currentSet[x] == 0:

                            currentSet[j] = 0
                            currentSet[x] = 1

                            testAbsErr = absoluteErrorCalculate(set, currentSet, target)





                            if 0 <= testAbsErr < bestSwapValue:

                                bestSwap = x
                                bestSwapValue = testAbsErr


                            currentSet[x] = 0
                            currentSet[j] = 1




                    if bestSwap != -1:


                        currentSet[bestSwap] = 1
                        currentSet[j] = 0

        if absoluteErrorCalculate(set, currentSet, target) < bestVal:

            bestSet = currentSet
            bestVal = absoluteErrorCalculate(set, currentSet, target)





    absErr = absoluteErrorCalculate(set, bestSet, target)
    end_time = time.perf_counter()
    run_time = end_time - start_time
    return absErr



def absoluteErrorCalculate(set,marks,target):

    total = 0

    for i in range(len(set)):
        if marks[i] == 1:
            total = total + set[i]

    absError = target - total

    return absError


